43c\u0435\u043d\u043d\u0438\u043a (\u0436\u0443\u0440\u043d\u0430\u043b)\">\u0421\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0438\u043a<\/a>\u00bb, \u2116&#160;9).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1875_%D0%B3%D0%BE%D0%B4\" title=\"1875 \u0433\u043e\u0434\">1875<\/a>&#160;\u2014 \u0421\u043e\u0437\u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D1%8B%D0%B9_%D1%81%D1%83%D0%B4_%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D1%8B\" title=\"\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u041a\u0430\u043d\u0430\u0434\u044b\">\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u041a\u0430\u043d\u0430\u0434\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1886_%D0%B3%D0%BE%D0%B4\" title=\"1886 \u0433\u043e\u0434\">1886<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%B5%D0%B0%D1%81,_%D0%96%D0%B0%D0%BD\" title=\"\u041c\u043e\u0440\u0435\u0430\u0441, \u0416\u0430\u043d\">\u0416\u0430\u043d \u041c\u043e\u0440\u0435\u0430\u0441<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0432 \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u0424\u0438\u0433\u0430\u0440\u043e\u00bb \u0441\u0442\u0430\u0442\u044c\u044e, \u0441\u0442\u0430\u0432\u0448\u0443\u044e \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442\u043e\u043c \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432-\u0441\u0438\u043c\u0432\u043e\u043b\u0438\u0441\u0442\u043e\u0432. \u0421\u0430\u043c\u0438 \u0442\u0435\u0440\u043c\u0438\u043d\u044b \u00ab\u0441\u0438\u043c\u0432\u043e\u043b\u0438\u0441\u0442\u00bb \u0438 \u00ab\u0441\u0438\u043c\u0432\u043e\u043b\u0438\u0437\u043c\u00bb \u0431\u044b\u043b\u0438 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u044b \u0432 \u044d\u0442\u043e\u043c \u043c\u0430\u043d\u0438\u0444\u0435\u044